export type ModelFormat = "pmd" | "pmx";

export type CorrdinateSystem = "left" | "right";

export type Pmd = {
    metadata: {
        format: "pmd";
        coordinateSystem: CorrdinateSystem;
        magic: string;
        version: number;
        modelName: string;
        comment: string;
        vertexCount: number;
        faceCount: number;
        materialCount: number;
        boneCount: number;
        ikCount: number;
        morphCount: number;
        morphFrameCount: number;
        boneFrameNameCount: number;
        boneFrameCount: number;
        englishCompatibility: number;
        englishModelName: string;
        englishComment: string;
        rigidBodyCount: number;
        constraintCount: number;
    };
    vertices: {
        position: [number, number, number];
        normal: [number, number, number];
        uv: [number, number];
        skinIndices: [number, number];
        skinWeights: [number, number];
        edgeFlag: number;
    }[];
    faces: {
        indices: [number, number, number];
    }[];
    materials: {
        diffuse: [number, number, number, number];
        shininess: number;
        specular: [number, number, number];
        ambient: [number, number, number];
        toonIndex: number;
        edgeFlag: number;
        faceCount: number;
        fileName: string;
    }[];
    bones: {
        name: string;
        parentIndex: number;
        tailIndex: number;
        type: number;
        ikIndex: number;
        position: [number, number, number];
    }[];
    iks: {
        target: number;
        effector: number;
        linkCount: number;
        iteration: number;
        maxAngle: number;
        links: { index: number; }[];
    }[];
    morphs: {
        name: string;
        elementCount: number;
        type: number;
        elements: {
            index: number;
            position: [number, number, number];
        }[];
    }[];
    morphFrames: {
        index: number;
    }[];
    boneFrameNames: {
        name: string;
    }[];
    boneFrames: {
        boneIndex: number;
        frameIndex: number;
    }[];
    englishBoneNames: {
        name: string;
    }[];
    englishMorphNames: {
        name: string;
    }[];
    englishBoneFrameNames: {
        name: string;
    }[];
    toonTextures: {
        fileName: string;
    }[];
    rigidBodies: {
        name: string;
        boneIndex: number;
        groupIndex: number;
        groupTarget: number;
        shapeType: number;
        width: number;
        height: number;
        depth: number;
        position: [number, number, number];
        rotation: [number, number, number];
        weight: number;
        positionDamping: number;
        rotationDamping: number;
        restitution: number;
        friction: number;
        type: number;
    }[];
    constraints: {
        name: string;
        rigidBodyIndex1: number;
        rigidBodyIndex2: number;
        position: [number, number, number];
        rotation: [number, number, number];
        translationLimitation1: [number, number, number];
        translationLimitation2: [number, number, number];
        rotationLimitation1: [number, number, number];
        rotationLimitation2: [number, number, number];
        springPosition: [number, number, number];
        springRotation: [number, number, number];
    }[];
};

export type GroupMorph = {
    index: number;
    ratio: number;
};

export type VertexMorph = {
    index: number;
    position: [number, number, number];
};

export type BoneMorph = {
    index: number;
    position: [number, number, number];
    rotation: [number, number, number, number];
};

export type UvMorph = {
    index: number;
    uv: [number, number, number, number];
};

export type MaterialMorph = {
    index: number;
    type: number;
    diffuse: [number, number, number, number];
    specular: [number, number, number];
    shininess: number;
    ambient: [number, number, number];
    edgeColor: [number, number, number, number];
    edgeSize: number;
    textureColor: [number, number, number, number];
    sphereTextureColor: [number, number, number, number];
    toonColor: [number, number, number, number];
};

export type Pmx = {
    metadata: {
        format: "pmx";
        coordinateSystem: CorrdinateSystem;
        magic: string;
        version: number;
        headerSize: number;
        encoding: number;
        additionalUvNum: number;
        vertexIndexSize: number;
        textureIndexSize: number;
        materialIndexSize: number;
        boneIndexSize: number;
        morphIndexSize: number;
        rigidBodyIndexSize: number;
        modelName: string;
        englishModelName: string;
        comment: string;
        englishComment: string;
        vertexCount: number;
        faceCount: number;
        materialCount: number;
        boneCount: number;
        morphCount: number;
        frameCount: number;
        rigidBodyCount: number;
        constraintCount: number;
    };
    vertices: {
        position: [number, number, number];
        normal: [number, number, number];
        uv: [number, number];
        auvs: [number, number, number, number];
        type: number;
        skinIndices: number[];
        skinWeights: number[];
        skinC?: [number, number, number];
        skinR0?: [number, number, number];
        skinR1?: [number, number, number];
        edgeRatio: number;
    }[];
    faces: {
        indices: [number, number, number];
    }[];
    textures: string[];
    materials: {
        name: string;
        englishName: string;
        diffuse: [number, number, number, number];
        specular: [number, number, number];
        shininess: number;
        ambient: [number, number, number];
        flag: number;
        edgeColor: [number, number, number, number];
        edgeSize: number;
        textureIndex: number;
        envTextureIndex: number;
        textureIndex: number;
        envTextureIndex: number;
        envFlag: number;
        toonFlag: number;
        comment: string;
        faceCount: number;
    }[];
    bones: {
        name: string;
        englishName: string;
        position: [number, number, number];
        parentIndex: number;
        transformationClass: number;
        flag: number;
        connectIndex?: number;
        offsetPosition?: [number, number, number];
        grant?: {
            isLocal: boolean;
            affectRotation: boolean;
            affectPosition: boolean;
            parentIndex: number;
            ratio: number;
        };
        fixAxis?: [number, number, number];
        localXVector?: [number, number, number];
        localZVector?: [number, number, number];
        key?: number;
        ik?: {
            effector: number;
            target: any;
            iteration: number;
            maxAngle: number;
            linkCount: number;
            links: {
                index: number;
                angleLimitation: number;
                lowerLimitationAngle?: [number, number, number];
                upperLimitationAngle?: [number, number, number];
            }[];
        }
    }[];
    morphs: {
        name: string;
        englishName: string;
        panel: number;
        type: number;
        elementCount: number;
        elements: GroupMorph[] | VertexMorph[] | BoneMorph[] | UvMorph[] | MaterialMorph[];
    }[];
    frames: {
        name: string;
        englishName: string;
        type: number;
        elementCount: number;
        elements: {
            target: number;
            index: number;
        }[];
    }[];
    rigidBodies: {
        name: string;
        englishName: string;
        boneIndex: number;
        groupIndex: number;
        groupTarget: number;
        shapeType: number;
        width: number;
        height: number;
        depth: number;
        position: [number, number, number];
        rotation: [number, number, number];
        weight: number;
        positionDamping: number;
        rotationDamping: number;
        restitution: number;
        friction: number;
        type: number;
    }[];
    constraints: {
        name: string;
        englishName: string;
        type: number;
        rigidBodyIndex1: number;
        rigidBodyIndex2: number;
        position: [number, number, number];
        rotation: [number, number, number];
        translationLimitation1: [number, number, number];
        translationLimitation2: [number, number, number];
        rotationLimitation1: [number, number, number];
        rotationLimitation2: [number, number, number];
        springPosition: [number, number, number];
        springRotation: [number, number, number];
    }[];
};

export type Vmd = {
    metadata: {
        coordinateSystem: CorrdinateSystem;
        magic: string;
        name: string;
        motionCount: number;
        morphCount: number;
        cameraCount: number;
    };
    motions: {
        boneName: string;
        frameNum: number;
        position: [number, number, number];
        rotation: [number, number, number, number];
        interpolation: [
            number, number, number, number, number, number, number, number,
            number, number, number, number, number, number, number, number,
            number, number, number, number, number, number, number, number,
            number, number, number, number, number, number, number, number,
            number, number, number, number, number, number, number, number,
            number, number, number, number, number, number, number, number,
            number, number, number, number, number, number, number, number,
            number, number, number, number, number, number, number, number
        ];
    }[];
    morphs: {
        morphName: string;
        frameNum: number;
        weight: number;
    }[];
    cameras: {
        frameNum: number;
        distance: number;
        position: number[];
        rotation: number[];
        interpolation: number[];
        fov: number;
        perspective: number;
    }[];
};

export type Vpd = {
    metadata: {
        coordinateSystem: CorrdinateSystem;
        parentFile: string;
        boneCount: number;
    };
    bones: {
        name: string;
        translation: [number, number, number];
        quaternion: [number, number, number, number];
    }[];
};

/**
 * @author takahiro / https://github.com/takahirox
 */
export class Parser {
    parsePmd(buffer: ArrayBufferLike, leftToRight: boolean): Pmd;
    parsePmx(buffer: ArrayBufferLike, leftToRight: boolean): Pmx;
    parseVmd(buffer: ArrayBufferLike, leftToRight: boolean): Vmd;
    parseVpd(text: string, leftToRight: boolean): Vpd;
    mergeVmds(vmds: Vmd[]): Vmd;
    leftToRightModel(model: Pmd|Pmx): void;
    leftToRightVmd(vmd: Vmd): void;
    leftToRightVpd(vpd: Vpd): void;
}
